import React, {useState} from 'react';
import { useRouter } from 'next/router'
import AdminLayout from "../components/AdminLayout";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import {Paper, TextField} from "@material-ui/core";
import Avatar from "@material-ui/core/Avatar";


export default function Profile() {
    const router = useRouter()
    const [userId, setUserId] = useState("");
    const [nMode, setNMode] = useState(true);

    return (
        <AdminLayout setNMode={setNMode} setUserId={setUserId}>
            <Typography variant="h5" gutterBottom style={{color: "grey", marginTop:15}}>
                Profile
            </Typography>

            {/* <Grid item xs={2} style={{justifyItems:"flex-end", justifyContent:"flex-end", backgroundColor:"", borderRadius:10}}> */}
                {/* <Grid item xs={100} > */}
                    <Paper style={{backgroundColor:"", color:"#fff", display:"flex"}}>
                    <Grid item xs={5} style={{backgroundColor:"lightgrey"}}>
                    <Avatar alt="Super Admin" src={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGvQLQ8CE9JyN11FHwSx4McRKThU-tc1pk_A&usqp=CAU"} style={{width:100, height:100}}></Avatar>
                    </Grid>
                    <Grid item xs={5} style={{backgroundColor:"blue"}}>
                                <Typography variant="body1" style={{color: "black", fontWeight:600}}>
                                    {/* {userName !== ""? userName: "loading..."} */}
                                    WC
                                </Typography>
                                <Typography variant="caption" style={{color: "black"}} gutterBottom>
                                    {/* {role} */}
                                    CCVVV
                                </Typography>
                </Grid>
                </Paper>
                {/* </Grid> */}
                    
                    
                {/* </Grid> */}
        </AdminLayout>
    )
}
